import stylesMenuItems from "./stylesMenuItems.module.css";

function MenuItems() {
  return (
    <div className={stylesMenuItems.box}>
      <p className={`${stylesMenuItems.ml_76px} text text_type_main-default`}>
        Булки
      </p>
      <p className="text text_type_main-default">Соусы</p>
      <p className={`${stylesMenuItems.ml_76px} text text_type_main-default`}>
        Начинки
      </p>
    </div>
  );
}

export default MenuItems;

